import React from "react";

const Hoc2 = () =>{
    return(
        <>
            <Red clr={Main}/>
        </>
    )
}

const Red = (props) =>{
    return(
        <>
            <h1 style={{color:'blue'}}><props.clr /></h1>
        </>
    )
}

const Main = () =>{
    return(
        <>
            <h1>MDF</h1>
        </>
    )
}

export default Hoc2;
